pragma solidity ^0.4.19;

contract Applications {
  string publicKey;
  string publicData;
  string encryptedData;

  mapping(address => string) applications; // all applicants, encrypted with different Gladius owned key
  address[] applicants;

  function Applications(string _publicKey, string _publicData, string _encryptedData) public {
    publicKey = _publicKey;
    publicData = _publicData;
    encryptedData = _encryptedData;
  }

  /*
  * get the public key
  */
  function getPublicKey() view public returns (string) {
    return publicKey;
  }

  /*
  * get the public data
  */
  function getPublicData() view public returns (string) {
    return publicData;
  }

  /*
  * get the encrypted data
  */
  function getEncryptedData() view public returns (string) {
    return encryptedData;
  }

  /*
  * submit application and get added to the list of applicants
  * @param _applicationData encrypted application data
  */
  function submitApplication(string _applicationData) public {
    applications[msg.sender] = _applicationData;
    applicants.push(msg.sender);
  }

  /*
  * list of all applicants
  */
  function getApplicants() view public returns(address[]) {
    return applicants;
  }

  /*
  * get application of specific applicant
  * @param _applicant applicant address
  */
  function getApplication(address _applicant) view public returns(string) {
    return applications[_applicant];
  }

}
